import React, { useState } from 'react';
import './styleComponents.css';
import Key from './Key';

const NumPad = () => {
  const keys1 = ["7", "8", "9"];
  const keys2 = ["4", "5", "6"];
  const keys3 = ["1", "2", "3"];
  const keys4 = ["10", "ENTER"];
  const [error,setError]=useState
  return (
    <div className='keyboard'>
      <div className='line'>
        {keys1.map((key) => 
          <Key key={key} keyVal={key} />
        )}
      </div>
      <div className='line'>
        {keys2.map((key) => 
          <Key key={key} keyVal={key} />
        )}
      </div>
      <div className='line'>
        {keys3.map((key) =>
          <Key key={key} keyVal={key} />
        )}
      </div>
      <div className='line'>
        {keys4.map((key) => 
          key === "ENTER" ? <Key key={key} keyVal={key} bigKey /> : <Key key={key} keyVal={key} />
        )}
      </div>
    </div>
  );
};

export default NumPad;
